import  {fromJS} from 'immutable';

const defaultState = fromJS({
  articleList: []
});

export default (state = defaultState, action) =>{
  switch (action.type) {
    case 'change_feed_data':
      state.set('articleList', fromJS(action.articleList));
      console.log(action)
    default:
      return state;
  }
}
